import React from "react";
import { useLocation } from "react-router-dom";

const Nweet = () => {
  const location = useLocation();
  const car = location.state.car_ip
  console.log(car)
  return (
    <div>
      <li>
        Hi {car.car_ip}
      </li>
    </div>
  );
};

export default Nweet;
